import React, { useEffect, useState } from 'react'
import { useParams } from 'react-router-dom';
import NewPost from './NewPost'

const Account = () => {

  const [posts, setPosts] = useState([]);
  const {user_id} = useParams();

  useEffect(() => {
    const fetchPosts = async() => {
      console.log(id);
      await axios.get(`http://localhost:8000/mypost/${user_id}`)
      .then(res => {
        setPosts(res.data);
        console.log(res.data);
      })
    }
    fetchPosts();
  },[])

  return (
    <div>
      <h1>Account</h1>
      {/* <a href="/account/">Add Post</a> */}
      <NewPost />

      <h1>My Post</h1>
      {/* <p>{posts[0].address}</p> */}
      {posts.map(p => (
        <div>
         {p.imgUrl.map(i => (
          <img src={i} alt="" width={300}/>
        ))}
        <p>{p.address}</p>
        <p>{p.mobile}</p>
        <p>{p.rent}</p>
        </div>
      ))}
    </div>
  )
}

export default Account;
